const eventSchema = new Schema({
  title: {
    type: String,
    required: true,
  },
  notes: {
    type: String
  },
  start: {
    type: Date,
    required: true
  },
  end: {
    type: Date,
    required: true
  },
  user: {
    type: Schema.Types.ObjectId,
    ref: 'User',
    required: true
  }
});


eventSchema.method('toJSON', function () {
